			page1.add(new PDFContent("text", "The Management Game", 203, 310, 1, 30,0,0,0,0,0, ""));
			page1.add(new PDFContent("line", "",0,0,0,0, 1.2 ,200, 340, 600, 340, "0.7176 0.6901 0.6901"));
			page1.add(new PDFContent("image", "3",45,400,120,90, 0 ,0,0,0, 0, ""));
