	private static List<PDFContent> addFrame(List<PDFContent> page, long thickness){
		int lengthTop = 41;
		int lengthSide = 41;
		for(int i=0; i<=19; i++){
			page.add(new PDFContent("line", "",0,0,0,0, thickness, 15+(i*lengthTop), 585, lengthTop+(i*lengthTop), 585, ""));
			page.add(new PDFContent("line", "",0,0,0,0, thickness, 15+(i*lengthTop), 10, lengthTop+(i*lengthTop), 10, ""));
		}
		for(int i=0; i<=13; i++){
			page.add(new PDFContent("line", "",0,0,0,0, thickness, 16, 590-(i*lengthSide)-15, 16, 590-((i+1)*lengthSide), ""));
			page.add(new PDFContent("line", "",0,0,0,0, thickness, 820, 590-(i*lengthSide)-15, 820, 590-((i+1)*lengthSide), ""));
		}
		
		return page;
	}
	
	
	private static void writeEOF(ByteArrayOutputStream PDFWriter){
		printc(PDFWriter, "\n%%EOF");
	}
	
	private static void writeXrefStart(ByteArrayOutputStream PDFWriter){
		printc(PDFWriter, "startxref\n");
		printc(PDFWriter, Long.toString(objectPositions.get(objectPositions.size()-1)));
	}
	
	private static void writeTrailer(ByteArrayOutputStream PDFWriter){
		printc(PDFWriter, "trailer\n");
		printc(PDFWriter, "<< ");
		writeLine(PDFWriter, "/Size", Long.toString(currentObjectCount+1));
		writeLine(PDFWriter, "/Info", createReference(infoObject));
		writeLine(PDFWriter, "/Root", createReference(catalogObject));
		printc(PDFWriter, ">>\n");
	}
	
	private static void writeXref(ByteArrayOutputStream PDFWriter){
		printc(PDFWriter, "xref\n");
		printc(PDFWriter, "0 "+(currentObjectCount+1)+"\n");
		writeXrefLine(PDFWriter, filler(0, 10), filler(65535,5), "f");
		for (int i=1; i<=objectPositions.size()-1; i++){ //-1 because last position is position of xref itself
			writeXrefLine(PDFWriter, filler(objectPositions.get(i-1), 10), filler(00000,5), "n");
		}
	}
	
	private static String filler(String number, long toBeFilled){
		String result = filler(Long.parseLong(number), toBeFilled);
		return result;
	}
	
	private static String filler(long number, long toBeFilled){
		String result = new String();
		int numberOfDigitInNumber = Long.toString(number).length();
		for (int i=1; i<=(toBeFilled-numberOfDigitInNumber);i++){
			result+="0";
		}
		result+=Long.toString(number);
		return result;
	}
	
	private static void writeContentObjects(ByteArrayOutputStream PDFWriter){
		for (int i=1;i<=content.size();i++){
			for (int j=1; j<=content.get(i-1).size();j++){
				saveObjectPosition();
				writeObjectBegin(PDFWriter, ++currentObjectCount);
				String ToBeStreamed = createStream(i-1, j-1);
				int calculatedContentLength=ToBeStreamed.length();
				
				
//				if (content.get(i-1).get(j-1).getContentType()=="text"){
						printc(PDFWriter, "/Length "+calculatedContentLength+"\n>>\n");
//				}
				printc(PDFWriter, ToBeStreamed);
				printc(PDFWriter, "endobj\n");
			}
		}
	}
	
