	public static String createStream(int outerindex, int innerindex){
		String constructedString = new String();
		if(content.get(outerindex).get(innerindex).getContentType()=="text"){
			constructedString = "stream\n";
			constructedString += "/F"+content.get(outerindex).get(innerindex).getFontNumber();
			constructedString += " "+content.get(outerindex).get(innerindex).getFontSize();
			constructedString += " Tf\n";
			if (content.get(outerindex).get(innerindex).getColor()!=""){
				constructedString+= content.get(outerindex).get(innerindex).getColor()+" rg \n";
			}
			constructedString += "BT\n";
			constructedString += content.get(outerindex).get(innerindex).getPositionLeft() + " ";
			constructedString += content.get(outerindex).get(innerindex).getPositionBottom() + " ";
			constructedString += "Td\n";
			constructedString += "("+content.get(outerindex).get(innerindex).getContentStream()+") ";
			constructedString += "Tj\n";
			constructedString += "ET\n";
			if (content.get(outerindex).get(innerindex).getColor()!=""){
				constructedString+= "0 0 0 rg \n";
			}
			constructedString += "endstream\n";
		} else if(content.get(outerindex).get(innerindex).getContentType()=="line"){
			constructedString = "stream\n";
			constructedString += "q ";
			if (content.get(outerindex).get(innerindex).getColor()!=""){
				constructedString+= "\n"+content.get(outerindex).get(innerindex).getColor()+" RG \n";
			}
			constructedString += content.get(outerindex).get(innerindex).getThickness();
			constructedString += " w ";
			constructedString += content.get(outerindex).get(innerindex).getStartx();
			constructedString += " ";
			constructedString += content.get(outerindex).get(innerindex).getStarty();
			constructedString += " m ";
			constructedString += content.get(outerindex).get(innerindex).getEndx();
			constructedString += " ";
			constructedString += content.get(outerindex).get(innerindex).getEndy();
			constructedString += " l S ";
			if (content.get(outerindex).get(innerindex).getColor()!=""){
				constructedString+= "\n0 0 0 RG \n";
			}
			constructedString += "Q\n";
			constructedString += "endstream\n";
		} else if(content.get(outerindex).get(innerindex).getContentType()=="image"){
			constructedString = "stream\n";
			constructedString += "q\n";
			constructedString += "1 0 0 1 "+content.get(outerindex).get(innerindex).getPositionLeft()+" "+content.get(outerindex).get(innerindex).getPositionBottom()+" cm\n";
			constructedString += content.get(outerindex).get(innerindex).getFontNumber()+" 0 0 "+content.get(outerindex).get(innerindex).getFontSize()+" 0 0 cm\n";
			constructedString += "/I"+content.get(outerindex).get(innerindex).getContentStream()+" Do\n";
			constructedString += "Q\n";
			constructedString += "endstream\n";
		}
		return constructedString;
	}
	
	private static void writeKidPageObjects(ByteArrayOutputStream PDFWriter){
		currentContentObjectCounter = pagesObject+fontObjects.size()+content.size()+imageObjects.size();
		for (int i=1;i<=content.size();i++){
			saveObjectPosition();
			writeObjectBegin(PDFWriter, ++currentObjectCount);
			writeLine(PDFWriter, "/Type", "/Page");
			writeLine(PDFWriter, "/Parent", createReference(pagesObject));
			
			String collectedReference = new String();
			collectedReference = "[";
			for (int j=1;j<=content.get(i-1).size();j++){
				currentContentObjectCounter++;
				collectedReference+=createReference(currentContentObjectCounter)+" ";
			}
			collectedReference=collectedReference.substring(0, collectedReference.length()-1); //remove last space
			collectedReference+="]";
			writeLine(PDFWriter, "/Contents", collectedReference);
			
			writeObjectEnd(PDFWriter);
		}
	}
	
